import JsonFetch from "../utils/json-fetch";

 let result = {
    // 请求数据
    getSearchData: async function(){
        const getSearchData = await JsonFetch.get("http://localhost//search?query=test");
        console.log('2');
    return getSearchData;
    },
}

export default result;
